import React, { useState } from 'react';
import { View, Text, FlatList, Image, TouchableOpacity, TextInput, ScrollView, StyleSheet } from 'react-native';

const trendingItems = [
  { name: 'Big Mac', image: 'data:image/webp;base64,', price: 599 },
  { name: 'Fries', image: 'data:image/webp;base64,', price: 299 }
];

const menuItems = {
  Burgers: [
    { name: 'Big Mac', image: 'data:image/webp;base64,', price: 599 },
    { name: 'McChicken', image: 'data:image/webp;base64,', price: 399 },
    { name: 'Quarter Pounder', image: 'data:image/webp;base64,', price: 699 },
    { name: 'Cheeseburger', image: 'data:image/webp;base64,', price: 299 }
  ],
  Drinks: [
    { name: 'Coke', image: 'data:image/jpeg;base64,', price: 199 },
    { name: 'Sprite', image: 'data:image/webp;base64,', price: 199 },
    { name: 'Fanta', image: 'data:image/webp;base64,', price: 199 },
    { name: 'Iced Tea', image: 'data:image/webp;base64,', price: 249 }
  ],
  Fries: [
    { name: 'Small Fries', image: 'data:image/jpeg;base64,', price: 199 },
    { name: 'Medium Fries', image: 'data:image/jpeg;base64,', price: 299 },
    { name: 'Large Fries', image: 'data:image/jpeg;base64,', price: 399 },
    { name: 'Curly Fries', image: 'data:image/jpeg;base64,', price: 499 }
  ]
};

const McDonaldsUI = () => {
  const [cart, setCart] = useState([]);
  const [orderType, setOrderType] = useState('Delivery');
  const [showDeliveryForm, setShowDeliveryForm] = useState(false);
  const [address, setAddress] = useState('');
  const [phone, setPhone] = useState('');
  const [paymentMethod, setPaymentMethod] = useState('Cash on Delivery');

  const addToCart = (item) => {
    setCart([...cart, item]);
  };

  const getTotal = () => {
    return cart.reduce((total, item) => total + item.price, 0);
  };

  return (
    <View style={styles.container}>
      <View style={styles.navbar}>
        <Text style={styles.navText}>McDonald's</Text>
      </View>
      
      <ScrollView>
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Trending</Text>
          <ScrollView horizontal>
            {trendingItems.map((item, index) => (
              <View key={index} style={styles.menuCard}>
                <Image source={{ uri: item.image }} style={styles.menuImage} />
                <Text style={styles.menuText}>{item.name}</Text>
                <Text style={styles.price}>PKR {item.price}</Text>
                <TouchableOpacity style={styles.addButton} onPress={() => addToCart(item)}>
                  <Text style={styles.addButtonText}>Add to Cart</Text>
                </TouchableOpacity>
              </View>
            ))}
          </ScrollView>
        </View>

        {Object.keys(menuItems).map((category, index) => (
          <View key={index} style={styles.section}>
            <Text style={styles.sectionTitle}>{category}</Text>
            <ScrollView horizontal>
              {menuItems[category].map((item, idx) => (
                <View key={idx} style={styles.menuCard}>
                  <Image source={{ uri: item.image }} style={styles.menuImage} />
                  <Text style={styles.menuText}>{item.name}</Text>
                  <Text style={styles.price}>PKR {item.price}</Text>
                  <TouchableOpacity style={styles.addButton} onPress={() => addToCart(item)}>
                    <Text style={styles.addButtonText}>Add to Cart</Text>
                  </TouchableOpacity>
                </View>
              ))}
            </ScrollView>
          </View>
        ))}

        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Cart</Text>
          {cart.length > 0 ? (
            cart.map((item, index) => (
              <View key={index} style={styles.cartItem}>
                <Image source={{ uri: item.image }} style={styles.cartImage} />
                <Text style={styles.cartText}>{item.name} - PKR {item.price}</Text>
              </View>
            ))
          ) : (
            <Text style={styles.emptyCart}>Cart is empty</Text>
          )}
        </View>

        {cart.length > 0 && (
          <View style={styles.cartContainer}>
            <Text style={styles.cartTitle}>Your McDonald's Cart</Text>
            {cart.map((item, index) => (
              <View key={index} style={styles.cartItemContainer}>
                <Text style={styles.cartItem}>{item.name} - PKR {item.price}</Text>
              </View>
            ))}
            <Text style={styles.total}>Total: PKR {getTotal()}</Text>
            <TouchableOpacity style={styles.checkoutButton} onPress={() => setShowDeliveryForm(true)}>
              <Text style={styles.buttonText}>Proceed to Checkout</Text>
            </TouchableOpacity>
          </View>
        )}

        {showDeliveryForm && (
          <View style={styles.deliveryForm}>
            <Text style={styles.title}>Enter Delivery Details</Text>
            <TextInput 
              style={styles.input} 
              placeholder="Enter Address" 
              value={address} 
              onChangeText={setAddress} 
            />
            <TextInput 
              style={styles.input} 
              placeholder="Enter Phone Number" 
              keyboardType="phone-pad" 
              value={phone} 
              onChangeText={setPhone} 
            />
            <Text style={styles.label}>Select Payment Method:</Text>
            {['Cash on Delivery', 'Debit Card', 'McDonalds App Pay'].map((method) => (
              <TouchableOpacity key={method} onPress={() => setPaymentMethod(method)}>
                <Text style={[styles.option, paymentMethod === method && styles.selectedOption]}>{method}</Text>
              </TouchableOpacity>
            ))}
            <TouchableOpacity style={styles.confirmButton} onPress={() => {
              alert(`Order confirmed!\nAddress: ${address}\nPhone: ${phone}\nPayment: ${paymentMethod}`);
              setShowDeliveryForm(false);
              setCart([]);
            }}>
              <Text style={styles.buttonText}>Confirm Order</Text>
            </TouchableOpacity>
          </View>
        )}
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: '#fff' },
  navbar: { backgroundColor: '#FF0000', padding: 15, alignItems: 'center' },
  navText: { fontSize: 20, color: '#fff', fontWeight: 'bold' },
  section: { marginVertical: 10 },
  sectionTitle: { fontSize: 18, fontWeight: 'bold', margin: 10 },
  menuCard: { backgroundColor: '#f9f9f9', padding: 10, margin: 5, alignItems: 'center', borderRadius: 10 },
  menuImage: { width: 100, height: 100, borderRadius: 10 },
  menuText: { marginTop: 5, fontWeight: 'bold' },
  price: { color: 'green', fontWeight: 'bold' },
  addButton: { backgroundColor: '#FF0000', padding: 5, borderRadius: 5, marginTop: 5 },
  addButtonText: { color: '#fff', fontSize: 14 },
  cartItem: { flexDirection: 'row', alignItems: 'center', marginVertical: 5 },
  cartImage: { width: 50, height: 50, borderRadius: 5, marginRight: 10 },
  cartText: { fontSize: 16, fontWeight: 'bold' },
  emptyCart: { fontSize: 16, color: 'gray', textAlign: 'center' },
  cartContainer: { marginTop: 20, padding: 10, backgroundColor: '#FFF8DC' },
  cartTitle: { fontSize: 20, fontWeight: 'bold', textAlign: 'center' },
  cartItemContainer: { flexDirection: 'row', justifyContent: 'space-between', marginVertical: 5 },
  removeButton: { color: 'red' },
  checkoutButton: {
    backgroundColor: '#FFCC00',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 8,
    marginTop: 20,
    alignItems: 'center',
    justifyContent: 'center',
    marginBottom: 20,
  },
  buttonText: {
    fontSize: 16,
    fontWeight: 'bold',
    color: 'white',
  },
  deliveryForm: { marginTop: 20, padding: 10, backgroundColor: '#FFF8DC' },
  input: { borderWidth: 1, marginBottom: 10, padding: 8 },
  confirmButton: { backgroundColor: 'red', padding: 10, borderRadius: 5, marginTop: 10 },
  option: { fontSize: 16, padding: 5 },
  selectedOption: { fontWeight: 'bold', color: 'red' },
});

export default McDonaldsUI;
